import React from 'react';
import styles from './header.module.css';

function Header() {
  return (
      <div className={styles.header}>
          <div className="nav">
              <a href="" className="Link" ></a>
              <a href="" className="Link" ></a>
              <a href="" className="Link" ></a>
              <a href="" className="Link" ></a>

          </div>
      </div>
);
}
export default Header;
